import React from 'react';
// import { useState } from 'react';
// import PropTypes from 'prop-types'

 export default function LoginAuthPage(props){

    return(
        <>
            <div className='login-auth-detail-container' style={{display:props.disp, translateX:props.move}}>
                <div className='login-auth-container-header'>
                    Login
                </div>
                <div className='login-auth-container-body'>
                    <div className='login-auth-email-pass-container'>
                        <input type="text" placeHolder='Email' className='login-auth-body-email'/>
                        <input type="password" placeHolder='Password' className='login-auth-body-email'/>
                    </div>
                    <button className='login-auth-body-button'>LOGIN</button>
                </div>
                <div className='login-auth-container-signUp'>
                    Dont have an Account?&nbsp;&nbsp; <a href="/" style={{color:'white', textDecoration:'none'}}>Sign Up</a>
                </div>
            </div>
        </>
        
    );
 }
